import React from 'react'
import { BrowserRouter, Routes, Route,Outlet } from "react-router-dom";
import DashbordContent from "../components/dashbordContent";
import Register from '../views/register';
import AdminDashbord from '../views/dashbord/adminDashbord';
import PatientComponent from '../components/patientComponent';
import PatientDashbord from '../views/dashbord/patientDashbord';
 export default function RouteComponent(props){
 return (
    <>
    <AdminDashbord/>
    <Routes>
    <Route exact path="/dashbord" element={DashbordContent}></Route>
    <Route exact path="/patient" element={PatientDashbord}></Route>
   </Routes>
   <Outlet/>

   </>
 );

 }
